let funModule = (function() {
  return { // will immediately return the function
    isCuteMixin: function(obj) { // mixin method is defined here
      obj.isCute = function() { // same old property with method
        return true;
      };
    },  // singMixin is aanother mixin method inside the same module
    singMixin: function(obj) {
      obj.sing = function() {
         console.log("Singing to an awesome tune");
      };
    }
  }
})();
